A map pattern can also match any Joe value with field properties, e.g., an instance of a Joe class. The pattern's keys match the field names and the pattern's values match the field values. Key patterns must be string or Keyword constants that correspond to the field names, or interpolated expressions that evaluate to such strings or keywords. class Thing { method init(id, color) { this.id = id; this.color = color; }
} // These two statements are equivalent
var {"id": i, "color": c} = Thing(123, "red");
var {#id: i, #color: c} = Thing(123, "red"); As when matching Map values, the pattern can reference a subset of the object's fields.

81.body:
An instance pattern is like a map pattern , but it can match on the value's type as well as on its fields. For example, class Thing { method init(id, color) { this.id = id; this.color = color; }
} // These two statements are equivalent
var Thing{"id": i, "color": c} = Thing(123, "red");
var Thing{#id: i, #color: c} = Thing(123, "red"); An instance pattern consists of the name of the desired type, followed by a map pattern for its fields. For the pattern to match: The named type must be the target value's type or one of its supertypes. The value must have all of the specified fields. The field patterns must match. Types are matched based on their names, i.e., in var Thing{...} = thing; the type will match if Joe.typeOf(thing).name() == "Thing", not if Joe.typeOf(thing) == Thing. In other words, there is no requirement that the matched type is in scope; it is enough that the value being matched knows its type and that its type's name is the name included in the pattern. See Unscoped Types for more information.

82.body:
Values of record types can be matched by both map patterns and instance patterns ; but because each record type has a fixed number of fields in a known order, record types also support a special syntax that makes record types especially suited to pattern matching. record Person(name, age) {} var person = Person(Joe, 80); // These statements are identical
var Person(n, a) = person;
var Person{#name: n, #age: a} = person; The first form can only be used with a value of a record type; it matches the values of the type's fields in sequence. All fields must be represented. The field subpatterns can be any arbitrary patterns, as usual.

