Most Joe types are defined in the global environment as a variable with the type's name whose value is the type itself. E.g., the standard type String is referenced by the global variable String. A Joe class is defined in the scope that contains the class declaration. If class Thing {...} appears at global scope, it will define a global variable called Thing. If class Thing {...} appears in a local scope, e.g., in a function body, it will define a variable called Thing in that scope. A type defined in a scope is called a scoped type . But consider this case: function makeValue() { class MyType { ... } return MyType();
} var theValue = makeValue(); The function makeValue creates a class called MyType in its own scope and then returns an instance of the class. The variable MyType goes out of scope when makeValue returns; the type can no longer be accessed "by name" in any scope in the script. MyType is now said to be unscoped . And yet, theValue still has type MyType: // Prints "MyType"
println(Joe.typeOf(theValue).name()); Similarly, just as a client can extend Joe with a binding for a scoped type (in exactly the same way as standard types like String and List), a client can also create values of named-but-unscoped types.

