The Joe.getFieldNames(value) method will return a list of the value's fields. For example, class Thing { method init(id, name) { this.id = id; this.name = name; }
} // Prints ["id", "name"]
println(Joe.getFieldNames(Thing)); If the given value is a Joe type, Joe.getFieldNames() will return the names of the type's static fields, not the names of its instance fields. It may seem odd to call Joe.getFieldNames() on a value to discover the value's fields, rather than on the value's type; but Joe types don't generally know the names of their instances' fields. Consider the following example: class Person { method init(name) { this.name = name; } } var fred = Person("Fred");
fred.favoriteFlavor = "chocolate";
fred.lastYearsFavorite = "vanilla"; Every Person is assigned a name in the initializer; but the script author has decided to add two additional fields to Person fred. A script can add any number of fields to any class instance, fields other instances of that type won't have. In fact, the Person type doesn't even know that every Person has a name. The init() method could be written to assign a value to this.name for some persons but not others. Thus, there's no way to query type Person to find the field names of its instances.

