The Joe tools, joe run et al , send their output to System.out. This is appropriate for a simple command-line tool; a more complex application might wish to redirect all script output to a log, or perhaps to swallow it unseen. Joe handles this via its outputHandler, a simple Consumer<String>. var joe = new Joe();
joe.setOutputHandler(text -> log(text)); The script-level print() and println() functions all send their output through this handler. Further, Joe provides Java-level print() and println() functions that do the same; this allows the body of any native function to easily output whatever it likes. private Object _square(Joe joe, ArgQueue args) { ... joe.println("In square()!");
